import React from "react";
import './estilos.css'
import bb8 from "../../../assests/bb8.png"

export default function ListUser({value}) {
    return (
        <div class="container">

            <text class="text" > {value} </text>
            <img src={bb8} tile="amiguinho" alt="bb8" />
            <text class="text" >  {value} </text>

        </div>
    );
}
